import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

// Placeholder components for routing
const Home = () => <div className="page-container">Welcome to Home</div>;
const Account = () => <div className="page-container">Your Account Details</div>;
const Courses = () => <div className="page-container">Courses Page</div>;
const Subscription = () => <div className="page-container">Subscription Info</div>;
const Contact = () => <div className="page-container">Contact Us</div>;

function App() {
  const [theme, setTheme] = useState("light"); // Theme state
  const [menuOpen, setMenuOpen] = useState(false); // State for mobile menu

  // Toggles theme between light and dark
  const toggleTheme = () => {
    const newTheme = theme === "light" ? "dark" : "light";
    setTheme(newTheme);
  };

  // Toggles mobile menu visibility
  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <Router>
      <div className={theme === "dark" ? "dark-mode" : "light-mode"}>
        {/* Navigation Bar */}
        <header>
          <nav>
            {/* Logo */}
            <div className="nav-logo">My Course App</div>
            {/* Hamburger menu for mobile */}
            <div className="hamburger-menu" onClick={toggleMenu}>
              &#9776;
            </div>
            {/* Navigation Links */}
            <ul className={`nav-links ${menuOpen ? "active" : ""}`}>
              <li>
                <Link to="/" onClick={() => setMenuOpen(false)}>Home</Link>
              </li>
              <li>
                <Link to="/account" onClick={() => setMenuOpen(false)}>Account</Link>
              </li>
              <li>
                <Link to="/courses" onClick={() => setMenuOpen(false)}>Courses</Link>
              </li>
              <li>
                <Link to="/subscription" onClick={() => setMenuOpen(false)}>Subscription</Link>
              </li>
              <li>
                <Link to="/contact" onClick={() => setMenuOpen(false)}>Contact</Link>
              </li>
            </ul>
            {/* Theme Toggle */}
            <div className="theme-toggle-container" onClick={toggleTheme}>
              <div className={`theme-toggle ${theme === "dark" ? "dark" : ""}`}></div>
            </div>
          </nav>
        </header>

        {/* Main Router Content */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/account" element={<Account />} />
          <Route path="/courses" element={<Courses />} />
          <Route path="/subscription" element={<Subscription />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>

        {/* Footer Section */}
        <footer>
          <p>Contact us at support@mycourseapp.com</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
